import React from "react";
import style from "./footer.module.css";
import Link from "next/link";

const Footer = (props) => {
  return (
    <footer className={style.footerStyle}>
      <div>
        <img src="logoCreate.png" />
      </div>
      <div>
        <img src="logoFooter.png" />
      </div>
      <div></div>
    </footer>
  );
};

export default Footer;
